With this app YOU CAN'T WATCH TV SHOWS OR MOVIES

MovieDiary will help you track and manage your movies Watchlist and store the history of watched movies in the one comfortable place.

Features:
- Track and discover Movies and TV Shows;
- Add Movies and TV Shows to your watchlist and manage them easily;
- Use Application without Authorization and user creation;
- Explore lists with popular, top rated and trending Movies or TV Shows;
- Create your personal Movies Lists;
- Synchronize between all your android devices;
- Filter your items by genre, type (movie or TV show), your score, viewing date;
- Find out Movies and TV Shows detailes: release date, duration, director, actors, description, tagline, MovieDiary user rating, Imdb rating, genres, etc .;
- Search for movies in the MovieDiary database in English, German and Russian;
- Choose from different themes;



With Movie Diary you will never lose any Movie or TV show.



You realy need MovieDiary if you are one of those who:

- Loves good movies and TV shows;
- Keeps your Watchlist in notes, notebook, messenger, etc;
- Sometimes can't quickly remember what awesome you have watched recently or what to recommend to friends.

Тут можете бесплатно 24/7 смотреть на лучших комиков, артистов, блогеров, музыкантов (только за интернет сами платите). Премьеры и эксклюзивы — два слова, которые сразу у нас заметите.

Стоп, где ваша одежда? Только начинаем описание приложения.

ЧТО ЖДЁТ ВНУТРИ:
— Ток-шоу с комиками — для времён, когда хочется подумать и наоборот;
— Стендап всех сортов и мастей;
— Спортивные шоу на приколах и без них;
— Подкасты о сексе, около-душевных штуках, терапии и юморе;
— Тиктокеры тоже тут со своими шоу, уже учат нас липсингу.

А ЗАЧЕМ ПРИЛОЖЕНИЕ? ВОТ ЗА ЭТИМ:
— Смотреть видео не только в полноэкранном режиме, но и в небольшом окне. На случай, когда хочется и в смартфон потыкать, и что-нибудь параллельно посмотреть;
— Слушать выпуски подкастами с заблокированным экраном;
— Транслировать шоу на большие экраны через вебкаст, AirPlay и Chromecast.

У НАС ШОУ ОТ ЛУЧШИХ ЛЮДЕЙ ИЗ МИРА СМЕШНОГО ИНТЕРНЕТА:
Антон Шастун, Азамат Мусагалиев, Денис Дорохов, Гарик Харламов, Тимур Батрутдинов, Евгений Чебатков, Арсений Попов, Дмитрий Позов, Сергей Матвиенко, Зоя Яровицына, Александр Якушев, Расул Чабдаров и ещё десятки лучших комиков.

И более 50 разных шоу! То есть всё серьезно, ну вы поняли.

ДО ВСТРЕЧИ

С «ВКармане ТВ (Мир)» Вы всегда сможете смотреть цифровое российское (а также СНГ) телевидение везде, где захотите. Вы не пропустите любимую ТВ-передачу или красивый и важный момент в футбольном матче, ведь для большинства каналов предусмотрен архив, а также пауза или перемотка прямого эфира до 10 часов назад (timeshift). Также можно послушать радио. «ВКармане ТВ (Мир)» не позволит Вам заскучать!

Возможности «ВКармане ТВ (Мир)»:
• быстрый запуск и переключение каналов;
• архив для многих телеканалов;
• пауза и перемотка эфира;
• просмотр телепрограммы (+ установка напоминаний);
• поиск ТВ-каналов;
• добавление каналов в любимый список;
• добавление каналов на экран «Домой»;
• режим "картинка в картинке" внутри приложения (возможность просмотра канала и навигации в «ВКармане ТВ (Мир)») - свайп сверху вниз по плееру;
• режим "картинка в картинке" при выходе из приложения (для iPad Air 2 и выше, а также iPhone с iOS 14);
• поддержка AirPlay;
• таймер сна;
• быстрый выход из канала - свайп вправо по плееру;
• быстрый поиск или переход в "Мои каналы" с домашнего экрана iPhone с помощью 3D-Touch;
• прослушивание телеканала в режиме радио;
• прослушивание радио-станций (отображение названия песни и исполнителя при прослушивании).

В приложении «ВКармане ТВ (Мир)» предусмотрены платные подписки на 1 месяц. Платные подписки позволяют Вам:
• получить доступ к контенту;
• получить возможность смотреть архив;
• отключить рекламу «ВКармане ТВ (Мир)».

Для того что бы получить доступ к закрытому контенту необходимо подписаться на один из платных пакетов со сроком подписки 1 месяц.
Оплата будет списываться с вашей учетной записи iTunes Store после подтверждения вами покупки.
Данная подписка в дальнейшем будет продлена автоматически, если она не будет отключена Вами по крайней мере за 24 часа до окончания текущего периода.
Оплата за продление подписки будут списана в течение 24 часов до окончания текущего периода согласно правилам iTunes Store.
Автоматическое продление может быть отключено в настройках iTunes Store в параметрах вашей учетной записи Apple ID.
